import React, { useState } from 'react';
import { useRef } from 'react';
import { Sidebar } from 'primereact/sidebar';
import { Button } from 'primereact/button';
import { Ripple } from 'primereact/ripple';
import { StyleClass } from 'primereact/styleclass';
import 'primeicons/primeicons.css';
import './Sidebar.css';

export default function SidebarComponent() {
    const [visible, setVisible] = useState(false);
    const btnRef1 = useRef(null);
    const btnRef2 = useRef(null);
    const btnRef3 = useRef(null);
    const btnRef4 = useRef(null);

    return (
        <div className="tarjeta flex justify-content-center">
            <Sidebar visible={visible} onHide={() => setVisible(false)} className="barra">
                <div className='flex flex-wrap align-items-center justify-content-between flex-shrink-0'>
                <img src="./Img/Logo1.png" alt="Logo de BDS" className="logo" />
                    <h2 className='nombre'>BDS</h2>
                </div>
                <hr className="mb-3 mx-3 borde-superior-1 borde-nulo borde-superficie" />
                <h2>Barra Lateral</h2>
                <div className="desbordamiento-y-auto">
                                    <ul className="lista-nada p-3 m-0">
                                        <li>
                                            <StyleClass nodeRef={btnRef1} selector="@next" enterClassName="oculto" enterActiveClassName="deslizar-abajo" leaveToClassName="oculto" leaveActiveClassName="deslizar-arriba">
                                                <div ref={btnRef1} className="p-ripple p-3 flex align-items-center justify-content-between texto-600 cursor-puntero">
                                                    <span className="fuente-mediana">FAVORITOS</span>
                                                    <i className="pi pi-chevron-down"></i>
                                                    <Ripple />
                                                </div>
                                            </StyleClass>
                                            <ul className="lista-nada p-0 m-0 desbordamiento-oculto">
                                                <li>
                                                    <a className="p-ripple flex align-items-center cursor-puntero p-3 borde-redondo texto-700 hover:surface-100 transicion-duracion-150 transicion-colores ancho-completo">
                                                        <i className="pi pi-home mr-2"></i>
                                                        <span className="fuente-mediana">Tablero</span>
                                                        <Ripple />
                                                    </a>
                                                </li>
                                                {/* Otros elementos de la lista */}
                                            </ul>
                                        </li>
                                    </ul>
                                    {/* Otra lista */}
                </div>
            </Sidebar>
                <Button icon="pi pi-arrow-right" onClick={() => setVisible(true)} className="boton-lateral">
                </Button>
                </div>
                )
}
